import { useEffect, useState } from 'react';

export default function AgeChecker({ number }) {
    const [age, setAge] = useState()

    const person = {
        age: 29
      }
    useEffect((number) => {
        let result = "Ok to drink"
        if(number < 18) result = "Under 18"
        if(number < 21) result = "Under 21"
        setAge(result)
    }, [number])

    return(
        <>
        {age}
        </>
    )
}
